'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for getting the account leverage profile by account ID")
class GetLeverageProfileByAcctCommand extends SendSingleCommandWithoutResponse {
    acctIds;
    offerIds;
    constructor() {
        super();
        this.commandName = "GetLeverageProfileByAcctCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetLeverageProfileByAcctRequestMessage(this.tradingSession, this.acctIds, this.offerIds, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = GetLeverageProfileByAcctCommand
